";s:6:"parent";s:1:"0";s:5:"count";s:2:"35";}i:30;O:8:"stdClass":10:{s:7:"term_id";s:2:"75";s:4:"name";s:15:"علي بابا";s:4:"slug";s:16:"%e2%80%aaalibaba";s:10:"term_group";s:1:"0";s:10:"term_order";s:1:"0";s:16:"term_taxonomy_id";s:2:"75";s:8:"taxonomy";s:6:"stores";s:11:"description";s:1778:"هو أكبر وأهم موقع صيني للتجارة الإلكترونية، والموقع متخصص في تداول المبيعات على شبكة الإنترنت للشركات من جميع أنحاء العالم وبلغات متعددة. تمتلك مجموعة علي بابا القابضة (غير المدرجة في البورصة) حصة ٪71.5 من مجموع أسهم موقع علي بابا في بورصة هونغ كونغ، حيث يمتلك مؤسسها "جاك ما" وأسرته حصة ٪7.4 من مجموع الشركة القابضة، فيما يستحوذ موقع ياهو على أكثر من ذلك بعد بيع بعض أصول الشركة له (مابين ٪33 ـ ٪24). في يوليو 2011، كانت مجموعة علي بابا القابضة تستحوذ على 3 مواقع من أصل 100 موقع الأكثر زيارة في العالم وهم موقع : (تاوباو (14)، موقع علي بابا (56)، علي باي (موقع) (85)، بالإضافة إلى موقع ياهو الصيني) بمعدل مجموعه 42 مليون زائر شهريا حسب مخطط الإعلانات التابع لجوجل. ولقد اكتتب على أسهم علي بابا في السوق يوم الخميس الثامن عشر من سبتمبر 2014 بسعر 68 دولار أمريكي للسهم الواحد وبحجم 25 مليار دولار. وتراوح سعر السهم الواحد في عام 2015 بين 60 و 66 دولار أمريكي. وكان قد تم اكتتاب هذا السهم في بورصة شنغهاي وهونغ كونغ عام 2010 والذي جمع 22 مليار دولار. ويزداد الطلب عليها بشكل متواصل مما ينبئ بتحقيق ارباح كبيرة جدا للشركة.";s:6:"parent";s:1:"0";s:5:"count";s:1:"1";}i:31;O:8:"stdClass":10:{s:7:"term_id";s:2:"57";s:4:"name";s:14:"فودافون";s:4:"slug";s:42:"%d9%81%d9%88%d8%af%d8%a7%d9%81%d9%88%d9%86";s:10:"term_group";s:1:"0";s:10:"term_order";s:1:"0";s:16:"term_taxonomy_id";s:2:"57";s:8:"taxonomy";s:6:"stores";s:11:"description";s:2153:"<div class="grid__item grid__item--middle grid__item--sm-1/1 grid__item--1/1">
